import styles from "../styles/Portfolio.module.css";
import portfolio1 from "../assets/portfolio1.png";
import portfolio2 from "../assets/portfolio2.png";
import portfolio3 from "../assets/portfolio3.png";
import portfolio4 from "../assets/portfolio4.png";
import portfolio5 from "../assets/portfolio5.png";
import portfolio6 from "../assets/portfolio6.png";
import Waves from "../components/Waves";

function Portfolio() {
    return (
        <div>
            <ul class={styles.portfolioFlex}>
                <li className={styles.portfolioImg}>
                    <img src={portfolio1} alt="Tree" class={styles.portfolioGallery} />
                </li>
                <li className={styles.portfolioImg}>
                    <img src={portfolio2} alt="Tree" class={styles.portfolioGallery} />
                </li>
                <li className={styles.portfolioImg}>
                    <img src={portfolio3} alt="Tree" class={styles.portfolioGallery} />
                </li>
                <li className={styles.portfolioImg}>
                    <img src={portfolio4} alt="Tree" class={styles.portfolioGallery} />
                </li>
                <li className={styles.portfolioImg}>
                    <img src={portfolio5} alt="Tree" class={styles.portfolioGallery} />
                </li>
                <li className={styles.portfolioImg}>
                    <img src={portfolio6} alt="Tree" class={styles.portfolioGallery} />
                </li>
            </ul>
            <Waves className="waves"/>
        </div >
    )
}

export default Portfolio;
